0Wagon＆One boxに重要な中低速でのトルクとクイックなレスポンスを実現し、スタイルにもこだわったスタンダードモデル。インナーサイレンサー無しの小容量砲弾型マフラーでありながらJASMA基準内の音量を保ちつつ、性能を犠牲にすることなく、中低速域におけるトルクとクイックレスポンスを同時に実現するという高機能マフラー。またエアロチューンを意識した遊び心満載のスタイルにこだわったデザインも魅力のひとつ。 <br>●材質：オールステンレス ●パイプ径（パイ）50 ●タイコ径（パイ）127 ●テール径（パイ）93 ●出口：S(右) ●リアピースのみ ●納期：お取り寄せ商品のため通常3～4日でのお届けとなります。(日・祝日は除く)万が一欠品の場合は別途メールにてご連絡差し上げます。お急ぎの場合はご注文前に必ず納期確認を頂きますようお願い申し上げます。<br> <br>対応車種：04/11～07/5 ZD11S スイフト 1.3L 4WD　エンジン型式：M13A <br>　保安基準適合品（JASMA認定）<br>排気系/マフラー<br>※送料は地域や配達場所によって変わりますが、6000円～12000円程度が目安となります。<tr><td colspan="2">
